import {
    BrowserRouter as Router,
    Routes,
    Route,
    BrowserRouter,
} from "react-router-dom";
import CreatePage from "./Pages/CreatePage";
import HomePage from "./Pages/Home";

function App() {
    return (
        <div className="app">
            <BrowserRouter>
                <Routes>
                    <Route path="/">
                        <HomePage />
                    </Route>
                    <Route path="/add">
                        <CreatePage />
                    </Route>
                </Routes>
            </BrowserRouter>
        </div>
    );
}

export default App;
